/**
 * @param {number[]} nums
 * @return {number}
 */
var minimumRightShifts = function(nums) {
    let discontinuities = 0;
    let minIndex = 0; // Track the index of the smallest element

    for (let i = 0; i < nums.length; i++) {
        // Find the index of the smallest element
        if (nums[i] < nums[minIndex]) {
            minIndex = i;
        }
        // Count discontinuities
        if (nums[i] > nums[(i + 1) % nums.length]) {
            discontinuities++;
        }
    }

    // If there's more than one discontinuity, sorting is impossible
    if (discontinuities > 1) return -1;
    // If the array is already sorted
    if (discontinuities === 0) return 0;
    // The array can be sorted by right shifting elements before the smallest element to the end
    return nums.length - minIndex;
};
